import React from "react";
import Button from "../UI/Button";
import Loading from "../UI/Loading";
import Card from "../UI/Card";
import TableRow from "./TableRow";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCheck} from  '@fortawesome/free-solid-svg-icons';

const Plans = () => {
  return (
    <Card>
      <table>
        <tr>
          <th>Plans</th>
          <th>Free</th>
          <th>Monthly</th>
          <th>Yearly</th>
          <th>Lifetime</th>
        </tr>
      </table>
      <TableRow
        title={"Crypto Data"}
        free={<FontAwesomeIcon icon={faCheck} />}
      />
      <TableRow title={"Borrow Assistance"} />
      <TableRow title={"Lend Assistance"} />
      <TableRow title={"Crypto Trade"} />
      <TableRow title={"NFT Trade"} />
    </Card>
  );
};

export default Plans;
